import React from 'react';

function App(){
    let hours= new Date(2022,2,7,19);
    hours = hours.getHours();
    let print='';


    if (hours>=1 && hours<12){
        print='good morning'
    }else if(hours>=13 && hours<19){
        print='good evening'
    }else{
        print='goot night'
    }

    return(
        <>
          <h1> hello sir,{print}</h1>
        </>
    )
}

export default App;
